                    "value": "Big Ben est le surnom de la grande cloche de 13,5 tonnes install\u00E9e dans la tour horloge appel\u00E9e Tour Elizabeth,  ou anciennement Clock Tower, du Palais de Westminster, qui est le si\u00E8ge du parlement britannique (Houses of Parliament), \u00E0 Londres.Seules les personnes qui habitent au Royaume-Uni peuvent visiter Big Ben, apr\u00E8s avoir obtenu une autorisation.Le b\u00E2timent fait face \u00E0 la Tamise, entre le Pont de Westminster (Westminster Bridge) et l'Abbaye de Westminster (Westminster Abbey).Un incendie d\u00E9vaste une partie du b\u00E2timent du Parlement en 1835. "
